import {useState, useEffect} from 'react'
import {FaSearch} from "react-icons/fa"
import './index.css'

const SearchMovie = () => {
  const [searchedMovie, setSearchedMovie] = useState("")

//   useEffect(() => {})

  const setInput = event => {
    setSearchedMovie(event.target.value)
  }

  const callApi = async () => {
    const response = await fetch("https://openlibrary.org/dev/docs/api/search.json")
    const data = response.json()
    console.log(data)
  }

  return (
    <div className="movies-search-box">
      <input
        type="text"
        placeholder="search movie"
        onChange={setInput}
        className="movies-input-bar"
        value={searchedMovie}
      />
      <button type="button" className="search-button" onClick={callApi}>
        <FaSearch />
      </button>
    </div>
  )
}

export default SearchMovie
